      text: "Doctors Appointment",
      sched: "Feb 6th 5:00pm",
      iscompleted: true,
    },
    {
      id: 2,
      text: "Meeting at school",
      sched: "Feb 6th 5:00pm",
      iscompleted: false,
    },
    {
      id: 3,
      text: "Food Shooping",
      sched: "Feb 6th 5:00pm",
      iscompleted: true,
    },
  ]);
  return (
    <div className='container'>
      <Header />
    </div>
  );
};

